import React from "react";
import ReactDOM from "react-dom";
import Card from "./componant/Card";
import Imformation from "./componant/Imformation";
import "./index.css";
const fevs ="netwflix";
const Fevseries =()=>{
  if (fevs==="netflix"){
    return(
      <Card
      key={Imformation[1].id}
      imgsrc={Imformation[1].imgsrc}
      category={Imformation[1].category}
      title={Imformation[1].title}
      link={Imformation[1].link}
    />
    )
  }else{
    return(
      <Card
      key={Imformation[3].id}
      imgsrc={Imformation[3].imgsrc}
      category={Imformation[3].category}
      title={Imformation[3].title}
      link={Imformation[3].link}
    />
    )
  }
}
ReactDOM.render(
  <>
    <div id="Heading">
      <h1 className="Heading">Top 5 Netflix Web Series</h1>
    </div>
    <div className="All">
      <Fevseries/>
